import React from 'react';
import Datepicker from '@myfe/cat-datepicker';

export default {

    renderEditor: function (value, changeHandler) {
        return (
            <Datepicker {...this.props}
                value={value}
                noValue={this.state.value===''}
                onChange={changeHandler}/>
        )
    },

    pickValue: value => value

}